    false,nt"url": null,nt"notes": "The 2005 Kansas Land Cover Patterns map
    represents Phase 1 of a two-phase mapping initiative occurring over a three-year
    period. The map is designed to be explicitly comparable to the 1990 Kansas Land
    Cover Patterns map. Using a similar methodology to produce the 2005 Kansas Land
    Cover Patterns map provides opportunities to identify and examine how the Kansas
    landscape has changed over a 15-year period. The map contains eleven land use/land
    cover classes. The positional accuracy and spatial resolution of the map are appropriate
    for producing 1:50,000 scale maps. The map is not intended to define precise boundaries
    between landscape features and while the source data has a spatial resolution of
    30 m x 30 m, the minimum map unit varies by land cover class and ranges between
    0.22 to 5.12 acres (see below). The formal accuracy assessment reports the map to
    have an overall accuracy level of 90.72%. User and Producer accuracies vary by land
    cover class and rural classes have higher accuracy levels (88-95%) than urban classes
    (48-78%). Users are encouraged to reference the reported accuracy levels in this
    report and/or metadata when using the 2005 Kansas Land Cover Patterns map. Digital
    versions of the map, metadata, and accuracy assessment can be accessed from the
    Data Access Support Center (DASC) website of the Kansas Geological Survey (http://www.kansasgis.org/)
    or the website of the Kansas Applied Remote Sensing Program (http://kars.ku.edu/).",nt"license_title":
